import React from 'react';

import './NavBar.css';
import NavToggler from './NavToggler';

function NavBar() {
    return (
        <div className="main-navigation-div">
            <a href="/" className="navigation-bar-logo-li"><img src={require('../Components/Menu/logo.svg')} alt="logo" className="navigation-bar-logo"/></a>
            <NavToggler /> 
        </div>
    );
}

export default NavBar;
